import React, { Component } from 'react'

export class AddFolder extends Component {
  render() {
    return (
      <form style={{display: 'flex' }}>
          <input 
            type="text" 
            name="title"
            style={{ flex: '10', padding: '5px' }} 
            placeholder="Add Folder ..."
          />
          <input 
            type="submit" 
            value="Submit"
            className="btn"
            style={{flex: '1'}} 
          />
      </form>
    )
  }
}

export default AddFolder
